import "./styles.css";

import React, { useEffect, useState } from "react";
import api from "./services/api";

export default function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch(api.get(produtos))
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      {data.map(item => (
        <p>{item.title}</p>
      ))}
    </div>
  );

